import React from 'react';
import './book.css';
const Book = (props) => {
    console.log(props.show.name);
return (
    <div className="book">
        <img src={props.img} class="img-fluid" alt="..." />
        <div className="title">
        <h1>{props.show.name}</h1>
        </div>
        <div className="rating">
            <h3>rating{props.show.rating.average}</h3>
        </div>
    </div>
)
};
export default Book;
